//www.apple.com/","https://www.amd.com/en","https://www.ti.com/","https://www.qualcomm.com/home","https://www.arm.com/company","https://airpix.in/"];var v=[{year:"2022",achs:[{name:"3rd place in 2 Wheeled Self-Balancing Bike",imgName:"2022-Eyantra1.jpg"},{name:"4th place in Robotic Functional Weeder",imgName:"2022-Eyantra2.jpg"},{name:"20 selections in Google Summer of Code",imgName:"2022-GSoC.jpg"},{name:"3rd place in AMD Xilinx Adaptive computing challenge (Data Centre AI Track)",imgName:"2022-Xilinx.jpg"}]},{year:"2021",achs:[{name:"2nd prize in Delta International Manufacturing Contest",imgName:"delta2021.jpeg"},{name:"1st place in ML track of Datathon by KJSCE",imgName:"2021-Datathon.jpg"},{name:"1st place in Vision Beyond Limits in IIT Bombay, Techfest",imgName:"2021-VBL.jpg"}]},{year:"2019",achs:[{name:"TATA Motors AI Hackathon",imgName:"2019-TATA Motors AI Hackathon.jpg"},{name:"Hunar 2.0",imgName:"2019-Hunar 2.0.jpg"},{name:"Smart India  Hackathon",imgName:"2019-Smart India  Hackathon.jpg"}]},{year:"2018",achs:[{name:"ABU RoboCon",imgName:"2018-ABU RoboCon.jpg"},{name:"NVIDIA Jetson Developer Challenge",imgName:"2018-NVIDIA Jetson Developer Challenge.jpg"},{name:"NVIDIA Jetson Developer Challenge",imgName:"2018-NVIDIA Jetson Developer Challenge1.png"},{name:"I HACK - IIT Bombay",imgName:"2018-I HACK - IIT Bombay.png"}]},{year:"2017",achs:[{name:"Global Cyber Challenge Peace-A-thon",imgName:"2017-Global Cyber Challenge Peace-A-thon.jpg"},{name:"Ernest Young Blockchain Hackathon",imgName:"2017-Ernest Young Blockchain Hackathon.jpg"}]},{year:"2014",achs:[{name:"ABU RoboCon",imgName:"2014-ABU RoboCon.jpg"}]},{year:"2010",achs:[{name:"SRA's humminger was awarded as one of the best nationally by DRDO.",imgName:"2010-DRDO Aerial Vehicle.jpg"}]}],y=[{name:"Companies",startups:[{imgName:"instamojo.png",name:"Aditya Sengupta",sub:"Instamojo aims to solve one problem  make the internet a trustworthy place for a business to grow. Instamojo started with Payment Links  a simple URL that one can copy and paste anywhere on the internet and receive payments online via any payment mode. Today its an eCommerce platform that allows anyone to open their own online store on the platform in just a few clicks.",externalLink:"https://www.instamojo.com/"}]}],w=[{imgName:"Avitra.jpg",name:"AVITRA",sub:"AVITRA is a 5-DOF Serial Manipulator retro-fitted on a holonomic drive platform capable of mapping unknown environments, autonomously navigating known environments and manipulating small objects of various shapes. It's driven by an Intel NUC, which gives the robot the ability to process the information around it with the help of industry-standard software like ROS due to which development and customization to fit various applications becomes more feasible.",githubLink:"https://github.com/SRA-AVITRA"},{imgName:"Venom.jpg",name:"VENOM (Quadruped)",sub:"Venom is an unmanned four legged robot equipped with RGB-Depth Camera and an ARM Processor for onboard computation. Most of the robots available in the industry make use of wheels for navigation. Whereas a legged vehicle like Venom, will give multiple-terrain mobility, superior to existing wheeled and tracked vehicles. It can also negotiate terrain with minimum of human guidance and intervention.",githubLink:"https://github.com/chinmaynehate/Venom"},{imgName:"drone.jpg",name:"PUSHPAC (Drone)",sub:"PUSHPAC ( Polymorphic & Unmanned Surveillance Hybrid Platform with Autonomous Capabilities ) is a hybrid unmanned vehicle developed for functioning both in air and underwater. PUSHPAC is capable of extracting data regarding the bed profile of a water body up to a depth of 10 metres, and also performing surveillance and localisation using its vision capabilities, underwater as well as in flight.",githubLink:"https://github.com/apoorva-21/PUSHPAC"}],j=[{imgName:"titan_legs.jpeg",name:"TitanLegs",sub:(0,c.jsxs)(c.Fragment,{children:["TitanLegs is a customly designed, small, mobile and economical quadruped robot specially for dynamic locomotion. It houses and is built on a powerful, efficient yet cost effective 3D printed BLDC(Brushless DC) Motor based Actuator.",(0,c.jsx)("br",{}),"Minimising power wastage, producing robust robotic locomotion and good mobility are some of the achieved objectives. Our team has taken the approach of designing from scratch most of the components, including a cycloidal gearbox, PCB design; so as to get the most out of low-cost components."]}),githubLink:"https://github.com/SRA-VJTI/TitanLegs"},{name:"EvoBorne",sub:(0,c.jsx)(c.Fragment,{children:"EvoBorne is a versatile multi-terrain modular robot designed to adapt to various surface and aerial environments, morphing its structure to meet the demands of its surroundings. It operates as a wheeled robot on land, navigating diverse terrains with speed and agility, and seamlessly transforms into a drone when flight is required. Equipped with advanced mapping techniques and a dynamic morphing capability, EvoBorne can autonomously switch between ground and aerial modes, optimizing performance for complex tasks such as search and rescue, environmental monitoring, and exploration. Its robust, customizable design makes it a powerful tool for overcoming challenging environments."}),githubLink:"https://github.com/SRA-VJTI/evo-borne",modelLink:"https://p3d.in/e/RI78R"},{imgName:"synapse32.jpeg",name:"Synapse32",sub:(0,c.jsx)(c.Fragment,{children:"Synapse32 is an ambitious and innovative project spearheaded by SRA, focused on the design, verification, and implementation of a RISC-V based CPU using Verilog HDL. Our goal is to develop a fully functional CPU core that we will initially deploy on FPGA platforms, with future plans to evolve it into a robust, high-performance softcore IP for Xilinx boards. Looking ahead, we also plan to enhance Synapse32 to a level where it can support more complex operations, including the capability to run Linux. This would demonstrate the cores ability to handle sophisticated software environments and expand its potential applications."}),githubLink:"https://github.com/SRA-VJTI/evo-borne"}],L=[{year:"2025",projects:[{name:"AutoPort",imgName:"Eklavya/Eklavya2025/AutoPort.png",sub:"Build an autonomous robot capable of navigating an indoor environment, avoiding obstacles, and delivering items from one location to another.",githubLink:"https://github.com/f0rgotteng0d/autoport"},{name:"Ballerina Cappucina",imgName:"Eklavya/Eklavya2025/BallerinaCappucina.png",sub:"Build an omnidirectional robot that autonomously collects and sorts colored objects using custom hardware and computer vision.",githubLink:"https://github.com/vedantmalkar/Ballerina-Cappucina"},{name:"CustomBoot-32",imgName:"Eklavya/Eklavya2025/CustomBoot32.png",sub:"Design a STM32+ESP32 development board with custom bootloader and OTA support.",githubLink:"https://github.com/avm1234567/Customboot-32"},{name:"EchoCore",imgName:"Eklavya/Eklavya2025/EchoCore.png",sub:"Implement both B-mode ultrasound imaging and 16-QAM digital communication systems on FPGA using Verilog.",githubLink:"https://github.com/Shri-2112/Flexsonic"},{name:"FlexSonic",imgName:"Eklavya/Eklavya2025/FlexSonic.png",sub:"Design a smart glove that translates hand gestures into audible speech, empowering communication for the speech-impaired.",githubLink:"https://github.com/cupx0j0e/EchoCore"},{name:"FPGA-Based Tetris",imgName:"Eklavya/Eklavya2025/FPGA_Tetris.png",sub:"Build a tiny FPGA console that plays Tetris in real time rendered entirely in Verilog on a BeagleVFire.",githubLink:"https://github.com/Harshit6-b/SRA-FPGA-based-tetris"},{name:"GantryMate-200",imgName:"Eklavya/Eklavya2025/EklavyaGantry.png",sub:"Design and development of a gantry-style CNC system focusing on precision motion control, mechanical design, and firmware integration.",githubLink:"https://github.com/pushkardube/Eklavya_Gantry"},{name:"T5 Grammarator",imgName:"Eklavya/Eklavya2025/T5Grammarator.png",sub:"Fine-tune a T5 transformer model to fix grammar mistakes and serve it through a FastAPI endpoint.",githubLink:"https://github.com/sarayusapa/t5_grammarator"},{name:"Handheld Gaming Console",imgName:"Eklavya/Eklavya2025/HandheldGamingConsole.png",sub:"Build a custom STM32-based board that runs a simple Snake-style game on an LCD with bare-metal C and custom I\xb2C drivers.",githubLink:"https://github.com/Paarth-Shirsat/Handheld-Gaming-Console"},{name:"Quad-Move",imgName:"Eklavya/Eklavya2025/QuadMoveTrain.png",sub:"Train a PPO-based gait policy in MuJoCo and deploy it on a low-cost, tortoise-style quadruped.",githubLink:"https://github.com/Advait2211/quad_move_eklavya"},{name:"NovaPI",imgName:"Eklavya/Eklavya2025/NovaPI.png",sub:"Build a bare-metal OS on Raspberry Pi with HDMI and a Pong game from scratch.",githubLink:"https://github.com/dark-knightshanks/NovaPi"},{name:"RC Ornithopter",imgName:"Eklavya/Eklavya2025/RCOrnithopter.png",sub:"Build a remote-controlled, bird-scale ornithopter from scratch with bio-inspired design and precision engineering.",githubLink:"https://github.com/MAX090706/RC-ORNITHOPTER"},{name:"Re:Fine",imgName:"Eklavya/Eklavya2025/ReFine.png",sub:"Re:Fine is focused on improving large language model alignment using a dataset-free reinforcement learning pipeline combining synthetic data generation, rule-based evaluation (RULER), and GRPO optimization for controllable LLM behavior.",githubLink:"https://github.com/Coffeempty/Re-Fine---Eklavya-2025"},{name:"Robot Learning from First Principals",imgName:"Eklavya/Eklavya2025/RobotLearningFromFirstPrincipals.png",sub:"Combine simulation and real-world control of a SO100 robotic arm using vision, language, and machine learning.",githubLink:"https://github.com/vruga/lerobot-sim2real"},{name:"RubikNet",imgName:"Eklavya/Eklavya2025/RubikNet.png",sub:"Deep Reinforcement Learning for Rubiks Cube solving with stepper motor apparatus.",githubLink:"https://github.com/badboy1606/RubikNet"},{name:"Stewart Platform",imgName:"Eklavya/Eklavya2025/StewartPlatform.png",sub:"Design and control of a 6-DOF Stewart Platform for precise motion control, kinematics analysis, and real-time actuation.",githubLink:"https://github.com/Siddharth-33/Stewart-Platform"},{name:"Synapse32",imgName:"Eklavya/Eklavya2025/Synapse32.png",sub:"Design and verify a direct-mapped and set-associative cache subsystem for an existing RISC-V pipeline to reduce memory-access latency.",githubLink:"https://github.com/shashvatprabhu/SynapseCache"},{name:"ESP32 Flight Controller",imgName:"Eklavya/Eklavya2025/ESP32_Flight_Controller.png",sub:"Design and development of a quadcopter and a custom ESP32-based flight controller from scratch and control systems with the goal of achieving stable autonomous flight.",githubLink:"https://github.com/su1gets4/esp32-fc"}]},{year:"2024",projects:[{name:"ApexCore",imgName:"Eklavya/Eklavya2024/ApexCore.png",sub:"A single core cpu based on RV32 ISA",githubLink:"https://github.com/LOuLOu-THEKing/ApexCore_RISC-V_CPU"},{name:"Emg-Armband",imgName:"Eklavya/Eklavya2024/Emg-armband.jpg",sub:"The EMG-Armband project predicts hand gestures using EMG sensor data and machine learning for precise gesture recognition. It captures electrical signals from forearm muscle movements to identify gestures. Potential applications include assistive devices, robotics, and interactive systems.",githubLink:"https://github.com/vovw/emgband"},{name:"Titan Quadruped",imgName:"Eklavya/Eklavya2024/Titan Quadruped.png",sub:"The project focuses on designing, testing, and controlling quadruped robot legs, assessing torque, load, and shock capacities. It involves CAD software like SOLIDWORKS, ONSHAPE, or FUSION360 for assembly. Testing includes various terrains and environmental constraints.",githubLink:"https://github.com/Krusshhnnaa/Titan_quadruped_sra"},{name:"Video Card on FPGA",imgName:"Eklavya/Eklavya2024/Video card on FPGA.jpg",sub:"This project focuses on the design and implementation of a video card using FPGA technology, capable of displaying images with up to 64 colors through an analog VGA interface. ",githubLink:"https://github.com/MrCheese260/Eklavya-Video-Card-Project"},{name:"Voice-Video-Manipulator",imgName:"Eklavya/Eklavya2024/Video voice manipulator.png",sub:"Takes in video input via a camera,processes the images it captures and calculates the distance and the coordinates of the particular object and reaches out that particular point in the space",githubLink:"https://github.com/MASQUERADE-2005/SRA_VVM"},{name:"Raytracer from Scratch",imgName:"Eklavya/Eklavya2024/RayTracer From Scratch.png",sub:"A Raytracing application built entirely from scratch using C++ and OpenGL",githubLink:"https://github.com/JaytidaA/SRA-Ray_Tracer_from_Scratch/"},{name:"Vision Transformers From Scratch",imgName:"Eklavya/Eklavya2024/vision transformers from scratch.png",sub:"Implement vision transformers(ViTs) model from scratch and generate descriptive captions for images by combining the power of Vision Transformers and computer vision.",githubLink:"https://github.com/sneha31415/vision_transformers_from_scratch/"},{name:"Convolution on FPGA",imgName:"Eklavya/Eklavya2024/Convolution On FPGA.png",sub:"Implementing convolution on FPGA",githubLink:"https://github.com/5usu/convolutions-on-fpga"},{name:"LQR BALANCER",imgName:"Eklavya/Eklavya2024/LQR Balancer.jpeg",sub:"SELF BALANCING BOT (WALL E) USING LINEAR QUADRATIC REGULATOR",githubLink:"https://github.com/crisiumnih/LQR_Balancer"},{name:"Gymmaster",imgName:"Eklavya/Eklavya2024/gym master.jpg",sub:"Our project focuses on understanding and implementation of concepts of Reinforcement learning through various control problems",githubLink:"https://github.com/De-funkd/gym_master-Sra-.git"},{name:"Gyro Glider",imgName:"Eklavya/Eklavya2024/Gyro Glider.png",sub:"Project Gyroglider is to revolutionise the Evobourne bot by equipping it with self-balancing capabilities. By harnessing the power of two BLDC motors as thrusters and two N20 motors as wheels. ",githubLink:"https://github.com/AmeyaTikhe/Gyroglider"},{name:"Micromouse",imgName:"Eklavya/Eklavya2024/MicroMouse.png",sub:"Micromouse is a small, autonomous robot designed to navigate and solve a maze. It is a popular robotics competition where participants build and program a robot (mouse) to autonomously find its way from a starting point to the center of a maze in the shortest possible time. The competition combines aspects of robotics, algorithm development, and engineering design, making it a challenging and educational project for students, hobbyists, and professionals alike.",githubLink:"https://github.com/Ojasp21/Micromouse/"}]},{year:"2023",projects:[{name:"LangCraft",imgName:"Eklavya/Eklavya2023/LANG-CRAFT.png",sub:"The project is to create a custom programming language from scratch. It will involve defining the syntax of the language, implementing a lexer, developing a parser to construct an AST, and building a tree-walk interpreter to execute the code written in the custom language.",githubLink:"https://github.com/siddhip2004/Lang-craft_eklavya23"},{name:"OpenGl 3D Game Engine",imgName:"Eklavya/Eklavya2023/OpenGL_3D_GameEngine.png",sub:" The project aims to build a 3D Game, specifically Chess, using the libraries of OpenGL. ",githubLink:"https://github.com/Ritika128/OpenGl-3d-GameEngine"},{name:"EMG Armband",imgName:"Eklavya/Eklavya2023/EMG_ARMBAND.png",sub:"To create an EMG (Electromyography) Arm Band, which may be worn as a bracelet, to detect hand movements and orientation via muscle impulses transmitted through your forearm.",githubLink:"https://github.com/anuj-akotkar/EMG_armband"},{name:"Digital Signal Processing on FPGA",imgName:"Eklavya/Eklavya2023/DSP on FPGA.png",sub:"The aim of this project is to implement the Canny edge detection algorithm on an FPGA. The Canny edge detector is one of the most widely used edge detection algorithms due to its good performance and robustness to noise. It is a multi-stage algorithm that includes 5 steps to detect the edges of the given image or a real objects",githubLink:"https://github.com/Herculoxz/DSP-ON-FPGA-"},{name:"GPGPU with CUDA",imgName:"Eklavya/Eklavya2023/GPGPU_with_CUDA.png",sub:"The project aims to leverage the speed and power of the multiple cores of the GPU to perform general purpose calculations on an NVIDIA GPU using CUDA C++ API. It also aims to demonstrate the usage of CUDA in research applications, and implement the algorithms of Image Pipeline using CUDA.",githubLink:"https://github.com/adiawaskar/GPGPU-with-CUDA"},{name:"WriteMate",imgName:"Eklavya/Eklavya2023/WriteMate.png",sub:"A RNN based model converting text into handwriting",githubLink:"https://github.com/Sanika-k-1317/Write-mate_eklavya23"},{name:"GestureSense",imgName:"Eklavya/Eklavya2023/GestureSense.png",sub:"The aim of this project is to develop a user-friendly navigation system for increased accessibility. By utilizing the webcam, the system will enable app navigation and computer interaction using hand gestures.",githubLink:"https://github.com/AryanNanda17/GestureSense"},{name:"ML model on FPGA",imgName:"Eklavya/Eklavya2023/ML_model_on_FPGA.png",sub:"The aim of this project is implementing ML model on FPGA to process the MNIST dataset. ML Model will be build using Convolutional Neural Networks and implemented on FPGA in verilog language.",githubLink:"https://github.com/Atharv1035/ML_Model_FPGA_Eklavya23.git"},{name:"Manipulator on Dynamixel",imgName:"Eklavya/Eklavya2023/Manipulator_OnDynamixel.png",sub:"Controlling and designing a 3-DOF Manipulator with the help of three dynamixel motors",githubLink:"https://github.com/proatharv/Manipulator-on-Dynamixel-/tree/main"},{name:"MazeBlaze",imgName:"Eklavya/Eklavya2023/MazeBlaze.png",sub:"Develop a Line following and Maze Solving bot based on PID controller which can find the shortest path in a given maze.",githubLink:"https://github.com/SurajSonawane2415/MazeBlaze"},{name:"Rotary Inverted Pendulum",imgName:"Eklavya/Eklavya2023/Rotary_Inverted_Pendulum1.png",sub:"This project aims to stabilise an Inverted Pendulum using a Linear Quadratic Controller (LQR) which provides optimally controlled feedback gains to enable the closed-loop stable and high performance design of systems.",githubLink:"https://github.com/Shankari02/Rotary_Inverted_Pendulum_using_LQR"},{name:"RISC-V CPU",imgName:"Eklavya/Eklavya2023/Risc-v_logo.png",sub:"Implement a RISC-V 32IM ISA based CPU.",githubLink:"https://github.com/saishock1504/RISC-V-Eklavya-23"},{name:"Scene Graph Generator",imgName:"Eklavya/Eklavya2023/scene_graph_generator.png",sub:"Detecting objects and their relations in images in the form of a graph data structure",githubLink:"https://github.com/Kamakshi8104/Scene_graph_generator"},{name:"Soft Quad",imgName:"Eklavya/Eklavya2023/SoftQuad.jpeg",sub:"Our project focuses on developing a Quadruped Robot which is capable of overcoming obstacles using soft materials. By using advanced sensors, intelligent algorithms and working on mechanical and PCB design, we can enable the robot to achieve seamless collaboration and efficient navigation within the environment.",githubLink:"https://github.com/pavit15/softquad"},{name:"ROSfunc",imgName:"Eklavya/Eklavya2023/Rosfunc.png",sub:"Build a ROS like publisher-subscriber communication model using functional programming",githubLink:"https://github.com/richa-sawant/ROSfunc_EKLAVYA23"},{name:"Leg of the Titan",imgName:"Eklavya/Eklavya2023/titanlegs_design1.png",sub:"This project aims to design a Leg for a Quadruped robot, test it against forces and torque, and stimulate in Gazebo as well as Manufacturing.",githubLink:"https://github.com/SKYBIRDSGP/Titanleg_Design_EKLAVYA_2023/blob/main/README.md"},{name:"ctRL",imgName:"Eklavya/Eklavya2023/ctRL.jpg",sub:"This project intends to be an introduction to reinforcement learning based control systems. It will involve the study and implementation of classic reinforcement learning algorithms, at least one of which will running on an RPi to solve a control problem.",githubLink:"https://github.com/Ariv-Fernandes/ctRL_Eklavya23"}]},{year:"2022",projects:[{name:"esp32-radio-tranceiver",imgName:"Eklavya/Eklavya2022/esp32_radio_Aryan Bawankar.jpg",sub:"Make a long range Transceiver using ESP32 boards and send control commands as well as messages over a long range.",githubLink:"https://github.com/SubodhBawankar/esp32-radio-tranciever"},{name:"Wall-E on FPGA",imgName:"Eklavya/Eklavya2022/WallE on Fpga - Omkar Hatekar.jpg",sub:"This project aims to build Wall-E bot but instead of esp32, we will be using FPGA as the brain of bot. Final goal of this project is to demonstrate line following and self balancing by integrating LSA and MPU with FPGA.",githubLink:"https://github.com/Kshitijpatil16/Eklavya-Wall-E-on-FPGA-"},{name:"GPGPU with GLES",imgName:"Eklavya/Eklavya2022/GPGPU_WITH_GLES - Komal Sambhus.png",sub:"To perform general purpose computations on the GPU of BeagleBone Black using GLES 2.0.",githubLink:"https://github.com/Pratham-Bot/GPGPU-with-GLES/tree/main"},{name:"LQR Inverted Pendulum",imgName:"Eklavya/Eklavya2022/LQR_Inverted_Pendulum - Mahesh Tupe.jpg",sub:"Building a self balancing inverted pendulum using LQR",githubLink:"https://github.com/vrnimje/Inverted-LQR-Bot-Eklavya"},{name:"Pothole-Detection",imgName:"Eklavya/Eklavya2022/pothole.jpeg",sub:"Using Oak-D camera to generate depth-map and detecting Potholes present on road from it.",githubLink:"https://github.com/Dhruvanshu-Joshi/Pothole-Detection"},{name:"Slam-OpenCV-Navigation",imgName:"Eklavya/Eklavya2022/Slam-CV-Nav - Advait Dhamorikar.png",sub:"A Simulation of a Bot in Gazebo and RViz which creates a map of its environment and navigates through it while avoiding obstacles.",githubLink:"https://github.com/notad22/SLAM-OpenCV-Navigation"},{name:"drone-terrain-reconstruction",imgName:"Eklavya/Eklavya2022/drone-terrain-reconstruction - Soham Mulye.png",sub:"3D reconstruction and meshing of the terrain data collected from the drone",githubLink:"https://github.com/Shazam213/dron